@Jelena98410494 @normanswan I'm a realist.

Dropping AZ now would mean pushing back the rollout for months. Getting everyone an alternative vaccine (Pfizer or another) is no longer possible by October.

I'd prefer to get a shot in my arm ASAP, even if it means a booster of an alternative vaccine next year.

